import uiPreview from "./uiPreview";

export default {
    "ui:title": "Media",
    "ui:preview": uiPreview,
    "ui:layout": "section",
    "ui:fieldset": [
        "images",
        "videos"
    ],
    "ui:options": {
        "collapsible": true
    },
    "images": {
        "ui:options": {
            "sortable": true
        },
        "ui:dialog": true,
        "ui:preview": {
            "select": {
                "title": "title"
            },
            prepare({formData}) {
                return {
                    title: formData.length + " bilder"
                }
            }
        },
        "ui:buttons": [
            {
                "type": "dialog",
                "icon": "search",
                "title": "Finn bilder"
            },
        ],
        "items": {
            "ui:layout": "module"
        }
    },
    "videos": {
        "ui:options": {
            "sortable": true
        },
        "ui:dialog": true,
        "ui:preview": {
            "select": {
                "title": "title"
            },
            prepare({formData}) {
                return {
                    title: formData.length + " videoer"
                }
            }
        },
        "ui:buttons": [
            {
                "type": "dialog",
                "icon": "search",
                "title": "Finn video"
            },
        ],
        "items": {
            "ui:layout": "module"
        }
    }
}
